import React, {Component} from 'react';
import './Hello.css';
import 'tachyons';

class Hello extends Component {
    render() {
        return (
        <div className='tc'>
        <h1>Hello World</h1>
        <p>Welcome to react</p>
        <p>{this.props.greeting}</p>
        <div className='flex items-center'>
        <img className='br-100' src={require('./locale.jpg')} alt='Catherine Reed' width={50}/>
        <p>My name is Catherine Reed and I'm a Journalist</p>
        </div>
        </div>
        );
   }
}

export default Hello;
